window.bookSummaryJSON = "<p>Friends?</p> <p>Lovers?</p> <p>Both?</p> <p>For Kora and Tariq, those lines have been blurred for a long time. Every time clarity seems to be within reach, something shifts, and in a single moment, focus is lost. Once again, they're in limbo. Between them, there is only one secret, with the power to permanently alter their relationship. For good or bad, neither of them knows-nor are they willing to take that risk.</p> <p>Through the pain of past tragedies and the pressure of current dramas, they always find solace in each other's arms. Inescapably connected by the interminable bond of friendship, Tariq and Kora navigate family, life, and love, searching for separate answers to a problem that has only has one, unavoidable solution.</p> <p><b>Contains mature themes.</b></p>"; 
